import React from 'react';
import './EDSOBPage.css';

const EDSOBPage = () => {
  return (
    <div className="edsob-page">
      <div className="edsob-container">
        {/* 页面标题 */}
        <div className="edsob-header">
          <h1 className="edsob-title">SBA WOSB and EDWOSB</h1>
        </div>

        {/* 合同信息标题 */}
        <div className="contract-info-section">
          <h2 className="contract-info-title">Contract Information</h2>
          <div className="contract-info-line"></div>
        </div>

        {/* 合同详细信息 */}
        <div className="contract-details-section">
          <p className="contract-details-text">
            SBA WOSB and EDWOSB Contract Information<br/>
            Contract Type: Women-Owned Small Business<br/>
            Certification: Economically Disadvantaged Women-Owned Small Business
          </p>
          <div className="contract-details-line"></div>
        </div>

        {/* 介绍内容 */}
        <div className="introduction-section">
          <p className="introduction-text">
            Introduction – The Women-Owned Small Business (WOSB) and Economically Disadvantaged Women-Owned Small Business (EDWOSB) programs are designed to provide contracting opportunities for women-owned small businesses in industries where women are underrepresented.
          </p>
        </div>
      </div>
    </div>
  );
};

export default EDSOBPage;
